import React, { useState } from 'react'
import Header from './Header';
import ListBody from './ListBody';

const App = () => {
    const [userList, setUserList] = useState([
        { firstName: "John", lastName: "Doe", email: "johndoe@gmail.com", age: 27 },
        { firstName: "Max", lastName: "Jaron", email: "maxjaron@gmail.com", age: 25 },
        { firstName: "Jan", lastName: "Kowalski", email: "jankowalski@gmail.com", age: 43 },
      ]);
  return (
    <div>
        <Header />
        <ListBody />
    </div>
  )
}

export default App
